fr_nes_output3:
Dans un programme comportant 3 études parallèles, randomisées, en double aveugle et contrôlées, le @@candesartan## (titré jusqu'à 32 mg en une seule prise quotidienne) a été comparé au @@placebo## au sein de 3 populations différentes:
1) des sujets avec symptômes d'@@insuffisance cardiaque## et fraction d'éjection (F.E.) abaissée (≤ 40%) qui ne pouvaient être traités par un inhibiteur de l'enzyme de conversion de l'angiotensine (IECA) en raison d'une intolérance démontrée (CHARM-Alternative);
2) des sujets avec symptômes d'@@insuffisance cardiaque## et F.E. ≤ 40%, déjà traités par un IECA (CHARM-Added);
3) des sujets avec symptômes d'@@insuffisance cardiaque## et F.E. normale (CHARM-Preserved).
